Description:
Contribute to the transformation of the human being, our families and the communities in which we live; help to create the conditions so that the Dominican people, both collectively and individually, can count on a reasonable opportunity to live a productive and healthy life, each in accordance to his/her needs, interests and potential; promote dialogue and understanding between the different sectors that compose our society; and focus as much on resolving the causes of society’s problems as their symptoms.  Community and neighborhood organization;
Personal, vocational and technical training;
Support to childhood and youth;
Formation of community leaders;
Education on water and sanitation;
Local economic development;
Health education;
Childhood survival;
Prevention of STD/HIV/AIDS;
Sexual and Reproductive Health (family planning);
Prevention of Tuberculosis and Malaria;
Physical infraestructures for environmental clean-up;
Community equipment (schools, community centres, etc);
House construction and improvement;
Physical infraestructure for disaster mitigation; 
Micro-credit for the informal business sector (microbusinessmen/women);
Housing credit;
Design of contingency plans;
Risk management training. 
Research, advocacy and project implementation in bio-energy;
Reforestation and watershed management. Haitian Institute for Integral Development (IHDI) Haiti
